import { CREATE_NEW_PLAN } from "./types"

export default ({operator, rig, wellName, planNumber, plan}) => {
  return (dispatch, getState) => {
    console.log(getState().plan.slice(-1))
  //   const currentPlanNumber = currentWellId.plan.slice(-1).planNumber ? currentWellId.plan.slice(-1).planNumber : 0;
  // const currentPlan = currentWellId.plan.slice(-1).plan ? currentWellId.plan.slice(-1).plan : {};
    dispatch({
      type: CREATE_NEW_PLAN, 
      payload: {
        operator,
        rig, 
        wellName,
        planNumber,
        plan
      }
    })
  }

}
